e & Michael Experience","startTime":null,"eventDescription":"Collectively, Prince and Michael Jackson helped define the early '80s era of MTV, revolutionized both R&B and popular music, and influenced thousands of musicians worldwide. The Prince and Michael Experience is meant to celebrate the music of two of the biggest pop cultural icons of our generation – a celebration carried out with love and mutual respect for both artists.

The music is far from the only thing happening at this party. There's theme dancing, a face-off between guests repping The Purple One or The King of Pop, and much, much more. This is the perfect night out to lounge with your friends, make some new friends, get your drink on, dance your ass off, and have the time of your life. Prince and Michael Jackson fans go toe-to-toe on the dance floor as DJ Dave Paul from San Francisco mixes album cuts, remixes, rare tracks, and hits from the two artists.

Dave Paul began his music career in 1984, starting as a mobile DJ and evolving into a prominent college radio and club DJ remixer in San Francisco. During the late '80s and early '90s, his weekly radio show Beat Box Fridays on college radio station KCSF was instrumental in breaking many hip-hop records in the Bay Area market. Utilizing various pseudonyms, Paul has produced records and created the world's first scratch tool for digital DJs, The Ultimate Scratch CD. In 1991 he launched the now-legendary publication The Bomb Hip-Hop Magazine, and in 1995 he transformed the magazine into a record label. The label's Return of the DJ series was ranked by Spin Magazine as No. 25 in  its 90 Greatest Albums of the '90s list. Paul has been featured in URB Magazine and XLR8R, has appeared on the front cover of Billboard, and was featured in the motion picture Scratch (2001). He has DJed throughout the US, toured Europe and the UK, released over 100 projects on his record label, and currently produces themed DJ parties, including the Prince and Michael Experience, which has been packing houses for a decade.","isMobileFriendly":"false","image":{"jumbo":{"path":"http://cdn.ticketfly.com/i/00/02/07/67/61-atjmbo.jpg","width":538,"height":301},"jumbo1":{"path":"http://cdn.ticketfly.com/i/00/02/07/67/61-atjmbo1.jpg","width":538,"height":301},"large":{"path":"http://cdn.ticketfly.com/i/00/02/07/67/61-atlg.jpg","width":300,"height":168},"large1":{"path":"http://cdn.ticketfly.com/i/00/02/07/67/61-atlg1.jpg","width":300,"height":168},"medium":{"path":"http://cdn.ticketfly.com/i/00/02/07/67/61-atmd.jpg","width":200,"height":112},"medium1":{"path":"http://cdn.ticketfly.com/i/00/02/07/67/61-atmd1.jpg","width":200,"height":112},"original":{"path":"http://cdn.ticketfly.com/i/00/02/07/67/61-og.jpg","width":538,"height":301},"small":{"path":"http://cdn.ticketfly.com/i/00/02/07/67/61-atsm.jpg","width":100,"height":56},"small1":{"path":"http://cdn.ticketfly.com/i/00/02/07/67/61-atsm1.jpg","width"